  function allPoints(map: Map): Point[] {
    let last = lastPoint(map);
    let points: Point[] = [];
    for (let y = 0; y <= last.y; y++) {
      for (let x = 0; x <= last.x; x++) {
        points.push({x:x, y:y});
      }
    }
    return points;
  }

  function pointWithinMap(point: Point, map: Map): boolean {
    let last = lastPoint(map);
    return point.x >= 0 && point.x <= last.x
      && point.y >= 0 && point.y <= last.y
  }

  function neighbours(point: Point, map: Map): Point[] {
    let points: Point[] = [
      {...point, x: point.x - 1},
      {...point, x: point.x + 1},
      {...point, y: point.y - 1},
      {...point, y: point.y + 1},
    ];
    return points.filter((p: Point) => pointWithinMap(p, map))
  }

  function height(point: Point, map: Map): number {
    return map[point.y][point.x]
  }

  function heights(points: Point[], map: Map): number[] {
    return points.map((point) => (height(point, map)));
  }

  function isLowPoint(point: Point, map: Map): boolean {
    return Math.min(...heights(neighbours(point, map), map)) > height(point, map);
  }

  function lastPoint(map: Map): Point {
    return {x: map[0].length - 1, y: map.length - 1}
  }

  function lowLevels(map: Map): number[] {
    return allPoints(map)
    .filter((point) => (isLowPoint(point, map)))
    .map((point) => (height(point, map)));
  }

  function riskLevel(map: Map): number {
    return _.sum(lowLevels(map).map((v) => (v+1)));
  }

