    it("knows last point", () => {
      expect(lastPoint(example)).to.eql({x:9, y:4})
    });

    [
      [{x:0,y:0}, example, [{x:1,y:0}, {x:0,y:1}]],
      [{x:2,y:2}, example, [{x:1,y:2}, {x:3,y:2}, {x:2,y:1}, {x:2,y:3}]],
      [{x:9,y:4}, example, [{x:8,y:4}, {x:9,y:3}]],
    ].forEach((v: any[]) => {
      let point: Point, map: Map, expected: Point[];
      [point, map, expected] = v;
      it(`knows neighbours - ${point} => ${expected}`, () => {
        expect(neighbours(point, map)).to.eql(expected);
      })
    });

    [
      [{x:0,y:0}, example, false],
      [{x:1,y:0}, example, true],
      [{x:2,y:2}, example, true],
      [{x:2,y:3}, example, false],
    ].forEach((v: any[]) => {
      let point: Point, map: Map, expected: boolean;
      [point, map, expected] = v;
      it(`knows if point is low - ${JSON.stringify(point)} => ${expected}`, () => {
        expect(isLowPoint(point, map)).to.eql(expected);
      })
    });
    it("knows the low points", () => {
      expect(lowLevels(example)).to.eql([1, 0, 5, 5])
    })
    it("knows the risk level", () => {
      expect(riskLevel(example)).to.eql(15)
    });
